import React from "react";
import "../styles/QRcode.css";

export default function QRCode(props) {
  console.log(props);
  return (
    <section className="qr-code">
      <img src={props.src} alt="" />
      <h3>Improve your front - end skills by building projects</h3>
      <p>3333</p>
    </section>
  );
}
